webpackJsonp([0x64cf735dda95],{1273:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Here’s an idea I stole from <a href="http://dougbelshaw.com/blog/">Doug Belshaw</a>: end of the week notes. Especially as I value making stuff, so highly, it seems sensible to recap my making efforts every week, and get further insight into what I’m doing. So, here goes! This week, I’ve been:</p>\n<ul>\n<li><strong>Writing and shipping</strong> a new eBook: <a href="https://gumroad.com/l/eOwj">Go Design Something</a>. Intended for other instructional design newbies who want some practical steps to creating a great portfolio.</li>\n<li><strong>Creating</strong> <a href="http://us10.campaign-archive2.com/?u=42226c0254a17e043bbf7bcb2&#x26;id=e4bf430d48">Issue 12 of the Go Design Something newsletter</a>. It’s been 3 months since my last issue! I redesigned it a bit to be more visual. I’d love some feedback on if it’s useful to you. You can subscribe in the sidebar if you’re interested.</li>\n<li><strong>Planning</strong> for a podcast. I’ve been listening to a lot of great podcasts lately. There aren’t many instructional design-specific options out there. I was thinking either a interview style, like Code Newbies or a short monologue style. Maybe a mix of both would be best?</li>\n<li><strong>Settling in</strong> to a new job. I got a new job at the University of Texas! I’m super excited. There are a lot of interesting projects on the horizon and I’m already getting the chance to integrate some of my front-end development skills to <a href="/blog/data-viz-experiments-with-google-charts/">create an interactive data viz on student journeys</a>.</li>\n</ul>',frontmatter:{date:"October 09, 2015",path:"/blog/weeknotes-109",title:"Weeknotes 10/9",tags:["making","weeknotes"],categories:["Showing my Work","Weeknotes"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2,src:"/static/WeekNotes-d581aab5b942497986155410d1fa632f-81d39.png",srcSet:"/static/WeekNotes-d581aab5b942497986155410d1fa632f-9a8d1.png 203w,\n/static/WeekNotes-d581aab5b942497986155410d1fa632f-c53f9.png 405w,\n/static/WeekNotes-d581aab5b942497986155410d1fa632f-81d39.png 810w,\n/static/WeekNotes-d581aab5b942497986155410d1fa632f-fda19.png 1024w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
